import React, { Component } from 'react';

class TrackingDelivery extends Component {
	render() {
		return (
			<>
				<div style={{marginLeft:"250px"}}>
					<label></label>
					<input
						type="text"
						className="form-control"
						name="client_name"
						placeholder={'Enter recipient phone numeber'}
						style={{textAlign:"center", marginTop:"300px", width:"700px"}}
						//value={value.value_name}
						//onChange={this.handleValueChange(idx)}
					/>
					<div style={{ float: 'right' }}>
					<button
						type="button"
						className="btn my-2 my-sm-0" 
						data-toggle="modal"
						style={{ background: '#82CAFA', color : 'white' }}
					>
					Tracking Delivery
					</button>
				</div>
				</div>
			</>
		);
	}
}

export default TrackingDelivery;
